import { StyleSheet, Text, View } from "react-native";

function About() {
  return (
    <View style={styles.container}>
      <Text style={styles.details}>
        The ML model API used in this app is well curated and backed by powerful
        datasets, which are based on past approvals of loan.
      </Text>
      <Text style={styles.details}>
        So what are you waiting for, predict your chances of loan approval using
        our app.
      </Text>
      <Text style={styles.heading}>Developed By:</Text>
      <Text style={styles.name}>Nikhil, Lakshya and Siddharth</Text>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#14bf98",
    alignItems: "center",
    justifyContent: "center",
    padding: 20,
    color: "#fff",
  },
  heading: {
    marginTop: 100,
    fontSize: 20,
    padding: 5,
    fontWeight: "bold",
    color: "#fff",
  },
  name: {
    fontSize: 20,
    padding: 5,
    fontWeight: "bold",
    color: "#fff",
  },
  details: {
    fontSize: 20,
    padding: 5,
    fontWeight: "bold",
    color: "#fff",
    textAlign: "center",
  },
});

export default About;
